import React from "react";

export default function Contact() {
  return (
    <div className="Contact-Page">
      <head>
        <script src="https://kit.fontawesome.com/b5bff501df.js"></script>
      </head>
      <div className="Contact-Container">
        <div className="Contact"><i className="fa fa-envelope-square"></i> Email: JackBPainter@gmail.com</div>
        <div className="Contact"><i className="fa fa-phone-square"></i> Telephone: 07704 706668</div>
        <div className="Contact"><i className="fab fa-linkedin"></i> LinkedIn: https://www.linkedin.com/in/painterjack/
        </div>
      </div>
    </div>
  );
}
